class AsyncCommandBus extends CommandBus {
  constructor() {
    super();
    this.queue = [];
    this.subscribers = [];
    this.allResults = [];
  }

  execute(commandName, command, args) {
    this.queue.push({
      commandName,
      command,
      args,
    });
    if (this.queue.length === 1) {
      this._executingCommand = commandName;
      setTimeout(() => this._next(), 1);
    }
  }

  _saveExecution(commandName, result) {
    const res = super._saveExecution(commandName, result);
    this.allResults.push(res);
    return res;
  }

  _next() {
    if (this.queue.length === 0) {
      this._complete();
      return;
    }
    const params = this.queue.shift();
    const ret = this._execute(params.commandName, params.command, params.args);
    if (isPromise(ret)) {
      ret.then(() => this._next());
      return;
    }
    this._next();
  }

  _complete() {
    this.subscribers.map(f => f(this._lastCommand, this.allResults));
  }

  subscribe(func) {
    this.subscribers.push(func);
  }

  observer(observerName, ...args) {
    if (this.isExecuting()) {
      return from(new Promise(resolve => this.subscribe(resolve)))
        .pipe(switchMap(() => super.observer(observerName, ...args)));
    }
    return super.observer(observerName, ...args);
  }
}

AsyncCommandBus.lift = function (source) {
  const bus = new AsyncCommandBus();
  bus.setSource(source);
  return bus;
};

export default AsyncCommandBus;

import { from } from 'rxjs/internal/observable/from';
import isPromise from '../utils/isPromise';
import { getObserver } from './registerObserver';
import { applyOperators } from './registerOperator';

const _applyCommandBus = (observer) => {
  if (!observer.setCommandBus) {
    applyOperators(observer);
  }
};

class CommandBus {
  constructor() {
    this._lastCommand = {
      value: null,
      name: null,
    };
  }

  setSource(source) {
    this._source = source;
  }

  getRxMap() {
    return this._source;
  }

  value() {
    return this._lastCommand;
  }

  execute(commandName, command, args) {
    return this._execute(commandName, command, args);
  }

  _saveExecution(commandName, result) {
    this._lastCommand = {
      value: result,
      name: commandName,
    };
    this._executingCommand = false;
    return result;
  }

  _execute(commandName, command, args) {
    this._executingCommand = commandName;
    const ret = command(this, args);
    const value = ret;
    if (isPromise(ret)) {
      return ret.then(data => this._saveExecution(commandName, data));
    }
    return this._saveExecution(commandName, value);
  }

  isExecuting() {
    return !!this._executingCommand;
  }

  getCommandName() {
    return this._executingCommand;
  }

  fromObserver(observer) {
    _applyCommandBus(observer);
    return observer.setCommandBus(this);
  }

  observer(observerName, ...args) {
    if (typeof observerName !== 'string') {
      const obser = from(observerName);
      _applyCommandBus(obser);
      return obser.setCommandBus(this);
    }
    const observer = getObserver(observerName);

    if (!observer) {
      throw new Error(`Observer ${observerName} not register`);
    }
    const obser = observer(this.getContext(), ...args);
    _applyCommandBus(obser);
    return obser.setCommandBus(this);
  }

  getContext() {
    return {
      RxMap: this.getRxMap(),
      lastExecution: this.value(),
      library: this.getRxMap().getMapLibrary(),
    };
  }
}

export default CommandBus;

