const _importFunctions = {};

// wait until body is defined before injecting link. This ensures a non-blocking load in IE11.
const ready = (cb) => {
  if (document.body) {
    return cb();
  }
  setTimeout(() => ready(cb));
  return null;
};

const getRef = () => {
  const refs = (document.body || document.getElementsByTagName('head')[0]).childNodes;
  return refs[refs.length - 1];
};

const addElement = (tag) => {
  ready(() => {
    const ref = getRef();
    // Inject link
    // Note: the ternary preserves the existing behavior of 'before' argument, but we could choose to change the argument to 'after'
    // in a later release and standardize on ref.nextSibling for all refs
    // Note: `insertBefore` is used instead of `appendChild`, for safety re: http://www.paulirish.com/2011/surefire-dom-element-insertion/
    if (ref && ref.parentNode) {
      ref.parentNode.insertBefore(tag, ref.nextSibling);
    } else {
      document.head.appendChild(tag);
    }
  });
};

const loadJS = url => new Promise((resolve) => {
  const implementationCode = args => resolve(args);
  const scriptTag = document.createElement('script');
  scriptTag.src = url;
  scriptTag.onload = implementationCode;
  scriptTag.onreadystatechange = implementationCode;
  addElement(scriptTag);
});

export const loadCSS = href => new Promise((resolve) => {
  const ss = document.createElement('link');
  ss.rel = 'stylesheet';
  ss.href = href;
  // temporarily set media to something inapplicable to ensure it'll fetch without blocking render
  ss.media = 'only x';
  addElement(ss);
  // A method (exposed on return object for external use) that mimics onload by polling document.styleSheets until it includes the new sheet.
  const onloadcssdefined = (cb) => {
    const resolvedHref = ss.href;
    const sheets = document.styleSheets;
    let i = sheets.length;
    i -= 1;
    while (i) {
      if (sheets[i].href === resolvedHref) {
        return cb();
      }
      i -= 1;
    }
    setTimeout(() => onloadcssdefined(cb));
    return null;
  };

  const loadCB = () => {
    if (ss.addEventListener) {
      ss.removeEventListener('load', loadCB);
    }
    ss.media = 'all';
    resolve(ss);
  };

  // once loaded, set link's media back to `all` so that the stylesheet applies once it loads
  if (ss.addEventListener) {
    ss.addEventListener('load', loadCB);
  }
  ss.onloadcssdefined = onloadcssdefined;
  onloadcssdefined(loadCB);
});

/**
   *
   *  Funcion que permite aadir librerias externas para cargar dinamicamente nuevos
   *  comandos y observadores
   *  la funcion recibe como parametro la ruta del fichero a cargar siguiendo el siguiente
   *  patron ${type}/${mapLib}@${version}/${command.key} y la funcion tiene que hacer el import
   *  dinamico import()
   * @example
   *
   * RxMap.addImportLib('test',arg => import(`../lib/${arg}`));
   *
   * @param {string} lib Nombre de la libreria
   * @param {function} func Funcion a invocar
   */
export const addImportFunction = (lib, func) => {
  _importFunctions[lib] = func;
};

export const loadLib = async (mapLib, type, name, version = 'latest') => {
  let command = name;
  if (typeof name === 'string') {
    command = {
      key: name,
      lib: 'rxmap',
    };
  }
  if (command.path) {
    await loadJS(`${command.path}/${type}/${mapLib}@${version}/${command.key}.js`);
    return getCommand(command.key);
  }
  const importFunc = _importFunctions[command.lib];
  if (importFunc) {
    const module = await importFunc(`${type}/${mapLib}@${version}/${command.key}`);
    return module.default;
  }
  throw new Error(`not Found Import function for ${command.lib}`);
};

export const loadAllRootLib = name => Promise.all(Object.keys(_importFunctions).map(key => _importFunctions[key](name)));

import { loadAllRootLib, loadCSS } from './importLazyLoad';
import { registerCommand } from './registerCommand';
import { registerObserver } from './registerObserver';

const loadAll = async (name) => {
  const register = await loadAllRootLib(name);
  if (register && register[0] && register[0].default) {
    register[0].default(registerCommand, registerObserver);
  }
};

export default async (lib, options = {}) => {
  const version = options.version || 'latest';
  if (lib === 'leaflet') {
    await loadCSS('https://unpkg.com/leaflet@1.3.4/dist/leaflet.css');
    const _lib = await import(/* webpackChunkName: "leaflet" */'leaflet');
    if (!options.noLoadCommands) {
      await loadAll(`leaflet@${version}`);
    }
    return _lib;
  }

  if (lib === 'google') {
    const { loadGoogle } = await import(/* webpackChunkName: "google" */'../utils/google');
    const _lib = await loadGoogle(options.key);
    if (!options.noLoadCommands) {
      await loadAll(`google@${version}`);
    }
    return _lib;
  }
  throw new Error(`Library ${lib} not supported`);
};

const _middlewares = {
  _global: [],
};

const _subscribers = [];

const compose = (command, ...funcs) => {
  if (funcs.length === 0) {
    return command;
  }
  if (funcs.length === 1) {
    return funcs[0](command);
  }
  return funcs.reduce((a, b) => a(b(command)));
};

const executeCommand = command => (commandBus, args) => command(commandBus.getContext(), ...args);

export const applyMiddlewares = (commandName, command) => {
  let middlewares = _middlewares._global;
  if (_middlewares[commandName]) {
    middlewares = _middlewares._global.concat(_middlewares[commandName]);
  }
  return compose(executeCommand(command), ...middlewares);
};

export const registerMiddleware = (commandName, ...middlewares) => {
  if (!commandName) {
    return;
  }
  if (typeof commandName === 'string') {
    _middlewares[commandName] = middlewares;
    _subscribers.forEach(func => func(commandName));
    return;
  }
  _middlewares._global = [commandName, ...middlewares];
  _subscribers.forEach(func => func());
};

export const subscribe = func => _subscribers.push(func);

import { applyMiddlewares, subscribe } from './middlewares';
import registerOperator from './registerOperator';
import AsyncCommandBus from './AsyncCommandBus';
import CommandBus from './CommandBus';

const registerCommands = {};

const isAsyncCommandBus = function (value) {
  return value && typeof value.subscribe === 'function' && typeof value.execute === 'function';
};

const createFunctionInCommandBus = (commandName, commandExecute) => {
  CommandBus.prototype[commandName] = function (...args) {
    let _this = this;
    if (!(isAsyncCommandBus(_this))
      && (commandName !== 'create' || (commandName === 'create' && this.createAsync))) {
      _this = AsyncCommandBus.lift(this);
    }
    _this.execute(commandName, commandExecute, args);
    return _this;
  };
};

const _registerCommand = (commandName, command) => {
  const commandExecute = applyMiddlewares(commandName, command);
  createFunctionInCommandBus(commandName, commandExecute);
  registerOperator(commandName, commandExecute);
};

/**
 * Permite registrar los comandos que luego se podra utilizar en @link {RxMap}
 * o desde los Observadores
 *  * @example
 *  // Registrar comando
 *  registerCommand('test',arg=>console.log(arg));
 *
 *  // Utilizar el comando
 *  RxMap.test('asasfasdf');
 *  RxMap.fromObserver(from(5)).test('asfadf').subscribe(console.log)
 *
 * @param {string} commandName Nombre del comando a regitrar
 * @param {function} command Commando a ejecutar
 * @param {object} [options] Opciones para el comando
 */
export const registerCommand = (commandName, command, options = {}) => {
  registerCommands[commandName] = { command, options };
  _registerCommand(commandName, command);
};

/**
 * Recupera la informacion adicional del comando a partir de su nombre
 * @param {string} commandName
 * @return {object}
 */
export const getCommandInfo = commandName => registerCommands[commandName].options;

/**
 * Recupera el comando a partir de su nombre
 * @param {string} commandName
 * @return {Function}
 */
export const getCommand = commandName => registerCommands[commandName].command;

/**
 * Recupera la lista de comandos registrados
 * @return {Array<String|command>}
 */
export const getAllCommandsName = () => Object.keys(registerCommands);

const updateCommandWithMiddleware = (commandName) => {
  const commandValue = registerCommands[commandName];
  if (commandValue) {
    _registerCommand(commandName, commandValue.command);
  }
};

subscribe((commandName) => {
  if (typeof commandName === 'string') {
    updateCommandWithMiddleware(commandName);
  } else {
    Object.keys(registerCommands).forEach(key => updateCommandWithMiddleware(key));
  }
});

export default registerCommand;

